    }
  }
  parent[key] = t;
  return t;
}

function parse(parts, parent, key, val) {
  var part = parts.shift();

  // illegal
  if (Object.getOwnPropertyDescriptor(Object.prototype, key)) return;

  // end
  if (!part) {
    if (isArray(parent[key])) {
